    <div className="px:5 lg:px-20">
      <div>
        <h1 className="font-bold text-xl py-7 ">Dilivery Address</h1>
        <AddressCard />
      </div>
      <div className="py-20 ">
        <OrderTracker />
      </div>

    </div>
  );
};

export default OrderDetails;
